function App() {

	function getDigitsSum(num){
    let sum = 0
    const arr = String(num).split('');
    console.log(arr)
    arr.forEach(element => {
      console.log(Number(element))
      sum += Number(element);
    });
    console.log(sum);
    return sum;
  }
  getDigitsSum(123);
  return (
    <p>{getDigitsSum(123)}</p>
  )
}

